import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { KartModuleRoutingModule } from './kart-module-routing.module';
import { KartComponent } from './Components/kart/kart.component';
import { PriceComponent } from './Components/price/price.component';
import { KartpriceComponent } from './Components/kartprice/kartprice.component';
import { MaterialModule } from '../material/material.module';
import { LocalUserKartpriceComponent } from './Components/local-user-kartprice/local-user-kartprice.component';
import { LocalUserPriceComponent } from './Components/local-user-price/local-user-price.component';

@NgModule({
  declarations: [
    KartComponent,
    PriceComponent,
    KartpriceComponent,
    LocalUserKartpriceComponent,
    LocalUserPriceComponent
  ],
  imports: [
    CommonModule,
    KartModuleRoutingModule,
    MaterialModule
  ]
})
export class KartModuleModule { 

